import './results.css';
import React, { useState, useEffect, useRef } from 'react';
import axios from 'axios';
import { useLocation } from 'react-router-dom';
import { Scatter } from 'react-chartjs-2';
import 'chart.js/auto';
import { drawQuadrantsPlugin } from './graph-shading.js'; // Adjust the path as necessary
import { drawCenterCirclePlugin } from './center-circle.js'; // Adjust the path as necessary
import 'chartjs-plugin-annotation';
import Chart from 'chart.js/auto';

// Register custom plugins
Chart.register(drawQuadrantsPlugin(Chart));
Chart.register(drawCenterCirclePlugin(Chart));

const quadrantInfo = {
  quadrant1: "Information about Quadrant 1",
  quadrant2: "Information about Quadrant 2",
  quadrant3: "Information about Quadrant 3",
  quadrant4: "Information about Quadrant 4",
  center: "Information about the Center Area"
};

function Results() {
  const [userData, setUserData] = useState(null);
  const [selectedInfo, setSelectedInfo] = useState("");
  const chartRef = useRef(null);


  const location = useLocation();

  useEffect(() => {
    const queryParams = new URLSearchParams(location.search);
    const email = queryParams.get('email');

    if (email) {
      axios.get(`http://localhost:3001/api/user-data?email=${email}`)
        .then(response => {
          console.log('Data received:', response.data);
          setUserData(response.data);
        })
        .catch(error => {
          console.error('Error fetching user data:', error);
        });
    } else {
      console.error('No email provided in query parameters');
    }
  }, [location]);



  function onChartClick(evt) {
    // Ensure the chart reference is available
    if (!chartRef.current) {
      console.log("Chart reference not available");
      return;
    }

    const chart = chartRef.current;
    const canvasPosition = chart.canvas.getBoundingClientRect();

    const x = evt.clientX - canvasPosition.left;
    const y = evt.clientY - canvasPosition.top;

    console.log("Clicked position:", x, y);


    const xValue = chart.scales.x.getValueForPixel(x);
    const yValue = chart.scales.y.getValueForPixel(y);

      // Assuming the center circle radius covers up to a certain percentage of the chart
  const centerCircleRadius = Math.min(chart.chartArea.right - chart.chartArea.left, chart.chartArea.bottom - chart.chartArea.top) * 0.5 * 0.5; // 50% of half the smaller dimension
  const centerX = (chart.chartArea.left + chart.chartArea.right) / 2;
  const centerY = (chart.chartArea.top + chart.chartArea.bottom) / 2;

  const distanceFromCenter = Math.sqrt(Math.pow(x - centerX, 2) + Math.pow(y - centerY, 2));

  if (distanceFromCenter < centerCircleRadius) {
    setSelectedInfo(quadrantInfo.center);
  } else {
    // Existing logic to determine which quadrant was clicked
    if (xValue >= medianX && yValue >= medianY) {
      setSelectedInfo(quadrantInfo.quadrant1);
    } else if (xValue <= medianX && yValue >= medianY) {
      setSelectedInfo(quadrantInfo.quadrant2);
    } else if (xValue <= medianX && yValue <= medianY) {
      setSelectedInfo(quadrantInfo.quadrant3);
    } else if (xValue >= medianX && yValue <= medianY) {
      setSelectedInfo(quadrantInfo.quadrant4);
    }
  }
}





  const chartData = userData ? {
    datasets: [{
      label: 'Leadership Style',
      data: [{
        x: parseInt(userData.winningFocus),
        y: parseInt(userData.teamFocus)
      }],
      backgroundColor: 'rgba(255, 99, 132, 1)',
      pointRadius: 10,
    }],
  } : {};

  const medianX = 18; // Median values for x-axis
  const medianY = 18; // Median values for y-axis

  const options = {
    aspectRatio: 1,
    scales: {
      x: {
        type: 'linear',
        position: 'bottom',
        min: 6,
        max: 30,
        title: {
          display: true,
          text: 'Win Focus',
          color: 'black'
        }
      },
      y: {
        min: 6,
        max: 30,
        title: {
          display: true,
          text: 'Team Focus',
          color: 'black'
        }
      }
    },
    onClick: onChartClick,
    maintainAspectRatio: true,
    plugins: {
      annotation: {
        drawTime: 'beforeDatasetsDraw',
        annotations: {
          // Quadrant and middle area annotations
          box1: {
            type: 'box',
            xMin: 6,
            xMax: medianX,
            yMin: medianY,
            yMax: 30,
            backgroundColor: 'rgba(255, 99, 132, 0.25)' // Red
          },
          box2: {
            type: 'box',
            xMin: medianX,
            xMax: 30,
            yMin: medianY,
            yMax: 30,
            backgroundColor: 'rgba(0, 255, 0, 0.25)' // Green
          },
          box3: {
            type: 'box',
            xMin: 6,
            xMax: medianX,
            yMin: 6,
            yMax: medianY,
            backgroundColor: 'rgba(0, 0, 255, 0.25)' // Blue
          },
          box4: {
            type: 'box',
            xMin: medianX,
            xMax: 30,
            yMin: 6,
            yMax: medianY,
            backgroundColor: 'rgba(255, 255, 0, 0.25)' // Yellow
          },
          boxMiddle: {
            type: 'box',
            xMin: medianX - 3, // Adjust these values based on how wide you want the middle area to be
            xMax: medianX + 3,
            yMin: medianY - 3,
            yMax: medianY + 3,
            backgroundColor: 'rgba(128, 128, 128, 0.25)' // Grey
          }
        }
      }
    }
  };

  return (
    <div className="results-container">
      <div className="centered-content">
        <h1 className="results-title">Your Results</h1>
        <p className="results-description">Here are the results of your leadership test:</p>
        {userData ? (
          <>
            <div className="chart-container">
            <Scatter ref={chartRef} data={chartData} options={options} />
            </div>
            {selectedInfo && <div className="info-display">{selectedInfo}</div>}
            <div className="leader-info">
              <h2>Leader Type: {userData.leaderType}</h2>
              <p>{userData.leaderDescription}</p>
            </div>
          </>
        ) : (
          <p>Loading results...</p>
        )}
      </div>
    </div>
  );
}

export default Results;
